DROP DATABASE IF EXISTS queuequicker;
CREATE DATABASE queuequicker;

USE queuequicker;

CREATE TABLE IF NOT EXISTS account (
    accountId BIGINT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    firstname VARCHAR(50) NOT NULL,
    lastname VARCHAR(50) NOT NULL,
    email VARCHAR(255) NOT NULL UNIQUE,
    password VARCHAR(255) NOT NULL,
    role ENUM('Customer', 'Wait Staff', 'Kitchen Staff', 'Manager')
);

CREATE TABLE IF NOT EXISTS menuItems (
    id INT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    name VARCHAR(50) NOT NULL,
    description TEXT,
    ingredients VARCHAR(255),
    price DECIMAL(6, 2) NOT NULL,
    thumbnail LONGTEXT,
    createdAt TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updatedAt TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
);

CREATE TABLE IF NOT EXISTS categories (
    id INT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    name VARCHAR(255) NOT NULL UNIQUE
);

CREATE TABLE IF NOT EXISTS menuItemsCategories (
    itemId INT UNSIGNED,
    categoryId INT UNSIGNED,
    PRIMARY KEY (itemId, categoryId),
    FOREIGN KEY (itemId) REFERENCES menuItems(id),
    FOREIGN KEY (categoryId) REFERENCES categories(id)
);

CREATE TABLE IF NOT EXISTS orders (
    id INT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    accountId BIGINT UNSIGNED,
    tableId INT UNSIGNED,
    subtotal DECIMAL(9, 2) NOT NULL,
    orderTime TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    paid ENUM("Unpaid", "Requesting", "Paid") NOT NULL DEFAULT "Unpaid",
    FOREIGN KEY (accountId) REFERENCES account(accountId)
);

CREATE TABLE IF NOT EXISTS orderItems (
    id BIGINT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    orderId INT UNSIGNED,
    itemId INT UNSIGNED,
    quantity INT UNSIGNED NOT NULL,
    note VARCHAR(255),
    status ENUM("Preparing", "Ready To Serve", "Served"),
    FOREIGN KEY (orderId) REFERENCES orders(id),
    FOREIGN KEY (itemId) REFERENCES menuItems(id)
);

CREATE TABLE IF NOT EXISTS tables (
    id INT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    tableName VARCHAR(255) NOT NULL,
    capacity INT UNSIGNED
);

CREATE TABLE IF NOT EXISTS requests (
    id INT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    tableId INT NOT NULL,
    timestamp TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    status ENUM('Waiting', 'Completed') NOT NULL DEFAULT 'Waiting',
    type ENUM('Bill', 'Assistance') NOT NULL
);

CREATE TABLE IF NOT EXISTS bookings (
    id INT UNSIGNED AUTO_INCREMENT PRIMARY KEY,
    user_id BIGINT UNSIGNED NOT NULL,
    table_id INT UNSIGNED NOT NULL,
    date DATE NOT NULL,
    start_time TIME NOT NULL,
    end_time TIME NOT NULL,
    guests INT NOT NULL,
    status ENUM('pending', 'seated') NOT NULL DEFAULT "pending",
    FOREIGN KEY (user_id) REFERENCES account(accountId),
    FOREIGN KEY (table_id) REFERENCES tables(id)
);

CREATE TABLE IF NOT EXISTS tiers (
    id INT UNSIGNED AUTO_INCREMENT PRIMARY KEY,
    tierName ENUM('Tier 1', 'Tier 2', 'Tier 3') NOT NULL DEFAULT 'Tier 3',
    discountPercentage INT NOT NULL,
    pointsThreshold INT NOT NULL,
    pointsToNextTier INT
);

CREATE TABLE IF NOT EXISTS accountLoyaltyTier (
    accountId BIGINT UNSIGNED,
    tierId INT UNSIGNED DEFAULT 3,
    points INT UNSIGNED DEFAULT 0,
    PRIMARY KEY (accountId), -- 1-1 relationship
    FOREIGN KEY (accountId) REFERENCES account(accountId),
    FOREIGN KEY (tierId) REFERENCES tiers(id)
);

